const svgCloser = "</svg>";

const jpg = '<svg width="285" height="189" viewBox="0 0 285 189" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><image width="285" height="189" xlink:href="data:image/jpeg;base64,"/></svg>';

const png = '<svg width="285" height="284" viewBox="0 0 285 284" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><image width="285" height="284" xlink:href="data:image/png;base64,"/></svg>';

const getLocale = async function() { 
  const locale = await snap.request({ method: 'snap_getLocale' });
  switch(locale) { 
    case 'es': 
    case 'es_419': 
      return 'es'; 
      break;
    default: 
      return 'en'; 
      break; 
  }
}; 

module.exports.onRpcRequest = async ({ origin, request }) => {
  switch (request.method) {
    case 'random':
      if (request.min !== undefined && request.max !== undefined) {
        const min = parseInt(request.min, 10);
        const max = parseInt(request.max, 10);
        return Math.floor(Math.random() * (max - min + 1)) + min;
      }
      return Math.random();
    case 'mystery':
      const locale = await getLocale();
      const mysteryResponse = answers[Math.floor(Math.random() * answers.length)][locale];
      try { 
        const question = request.params.question.trim();
        if(question==="Can I have 1 Bitcoin?" || question==="¬øMe puedes dar un Bitcoin?") { 
          return snap.request({
            method: 'snap_dialog',
            params: {
              type: 'alert', 
              content: panel([
                image(png)
              ]),
            },
          });
        }
        else if(question==="Who's a cutie?" || question==="¬øQui√©n es el m√°s lindo?") { 
          return snap.request({
            method: 'snap_dialog',
            params: {
              type: 'alert', 
              content: panel([
                image(jpg)
              ]),
            },
          });
        }
        else { 
          return snap.request({
            method: 'snap_dialog',
            params: {
              type: 'alert',  
              content: panel([
                text(`**${uiText.header[locale]}**`),
                divider(), 
                text(`${uiText.youasked[locale]} "_${question}_"`),
                text(uiText.says[locale]),
                image(`${svgOpener}<text text-anchor="middle" text-align="center" x="155" y="47" font-size="10px" font-family="Euclid Circular B,Roboto,Helvetica,Arial,sans-serif">${mysteryResponse}</text>${svgCloser}`),
              ]), 
            },
          });
        }
      } catch(err) { 
        return snap.request({
          method: 'snap_dialog',
          params: { 
            type: 'alert',
            content: panel([text(`You must ask a question!`)]),
          },
        });
      }
    default:
      throw new Error('Method not found.');
  }
};
